import validate from './ValidateDocs';
import { updateShopDocsSuccess } from '../../actions/shops';
import renderReactSelect from '../FormFields/renderReactSelect';
import renderFileInput from '../FormFields/renderFileInput';

class EditShopDocs extends Component {
  constructor(props) {
    super(props);
    this.state = {
      docsDetail: props.docsDetail,
    };
  }

  componentWillMount() {
    this.props.initialize(this.state.docsDetail);
  }

  submitMenuForm(values) {
    return updateShopDocs(values)
      .then((result) => {
        this.props.updateShopDocsSuccess(result.data.data, this.state.itemIndex);
        toast.success('Docs updated Successfully.');
        this.props.reset();
        this.props.updateDocsSlide(result);
      })
      .catch((error) => {
        // Handle the error
      });
  }

  renderFields() {
    const { docsDetail } = this.state;

    switch (docsDetail.docs_type) {
      case 'Aadhar Card':
        return (
          <>
            <div className="col-lg-12">
              <Field
                name="aadhar_number"
                component={renderField}
                type="text"
                className="form-control"
                label="Aadhar Number"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="link_to_file"
                component={renderField}
                type="text"
                className="form-control"
                label="Link to File"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="files"
                component={renderFileInput}
                label="Upload Files"
              />
            </div>
          </>
        );

      case 'PAN Card':
        return (
          <>
            <div className="col-lg-12">
              <Field
                name="pan_number"
                component={renderField}
                type="text"
                className="form-control"
                label="PAN Number"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="link_to_file"
                component={renderField}
                type="text"
                className="form-control"
                label="Link to File"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="files"
                component={renderFileInput}
                label="Upload Files"
              />
            </div>
          </>
        );

      case 'GST':
        return (
          <>
            <div className="col-lg-12">
              <Field
                name="gst_number"
                component={renderField}
                type="text"
                className="form-control"
                label="GST Number"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="tax_bracket"
                component={renderReactSelect}
                label="Tax Bracket"
                options={[
                  { value: 'GST - 5%(CGST - 5% ,SGST- 5%)', label: 'GST - 5%(CGST - 5% ,SGST- 5%)' },
                  { value: 'GST-12%(CGST - 6% ,SGST- 6%)', label: 'GST-12%(CGST - 6% ,SGST- 6%)' },
                  { value: 'GST-18%(CGST - 9% ,SGST- 9%)', label: 'GST-18%(CGST - 9% ,SGST- 9%)' },
                  { value: 'GST-28%(CGST - 14% ,SGST- 14%)', label: 'GST-28%(CGST - 14% ,SGST- 14%)' },
                ]}
                placeholder="Select Tax Bracket"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="link_to_file"
                component={renderField}
                type="text"
                className="form-control"
                label="Link to File"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="files"
                component={renderFileInput}
                label="Upload Files"
              />
            </div>
          </>
        );

      case 'FSSAI':
        return (
          <>
            <div className="col-lg-12">
              <Field
                name="fssai_number"
                component={renderField}
                type="text"
                className="form-control"
                label="FSSAI Number"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="expiry_date"
                component={renderDatePicker}
                label="Expiry Date"
                className="form-control"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="link_to_file"
                component={renderField}
                type="text"
                className="form-control"
                label="Link to File"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="files"
                component={renderFileInput}
                label="Upload Files"
              />
            </div>
            <div className="form-group ri-block col-lg-12">
              <ul className="cs-check-box">
                <li>
                  <div className="os-check-box">
                    <Field
                      name="is_suspended"
                      id="is_suspended"
                      component="input"
                      type="checkbox"
                    />
                    <label htmlFor="is_suspended">Suspend Restaurant after docs expiry date</label>
                  </div>
                </li>
              </ul>
            </div>
          </>
        );

      case 'Upload Menu':
        return (
          <>
            <div className="col-lg-12">
              <Field
                name="links_to_menu"
                component={renderField}
                type="text"
                className="form-control"
                label="Links to Menu"
              />
            </div>
            <div className="col-lg-12">
              <Field
                name="files"
                component={renderFileInput}
                label="Upload Files"
              />
            </div>
          </>
        );

      default:
        return (
          <div className="col-lg-12">
            <Field
              name="docs_type"
              component={renderField}
              type="text"
              className="form-control"
              label="Name"
              placeholder=""
            />
          </div>
        );
    }
  }

  render() {
    const { handleSubmit, submitting } = this.props;

    return (
      <form onSubmit={handleSubmit(this.submitMenuForm.bind(this))}>
        <div className="form-block">
          <div className="row">
            {this.renderFields()}
          </div>
        </div>
        <div className="row save-button-block">
          <div className="col-sm-12 align-self-center">
            <button
              type="submit"
              disabled={submitting}
              className="btn green-btn"
            >
              <i className="material-icons">check_circle</i> SUBMIT DETAILS
              {submitting && <i className="fa fa-spinner fa-spin"></i>}
            </button>
          </div>
        </div>
      </form>
    );
  }
}

EditShopDocs = reduxForm({
  form: 'EditShopDocsValue',
  destroyOnUnmount: true,
  enableReinitialize: true,
  keepDirtyOnReinitialize: true,
  validate,
})(EditShopDocs);

const mapDispatchToProps = (dispatch) => {
  return {
    updateShopDocsSuccess: (payload, index) => {
      dispatch(updateShopDocsSuccess(payload, index));
    },
  };
};

export default connect(null, mapDispatchToProps)(EditShopDocs);
